 (10,NULL,NULL,NULL,'高永强','13998618869','总经理','甘-10-1','大连中远船务工程有限公司是中远船务工程集团旗下的核心企业之一。公司以船舶与海洋工程产品的修理、改装、制造为主业。公司位于环渤海湾港口群的要冲、美丽的滨海城市大连。占地120万平方米，岸线总长3200米，市场遍及欧、美、亚多个国家和地区。公司拥有30万吨级浮船坞、15万吨级浮船坞和8万吨级干船坞各1座，坞容总量达到53万吨；专用修船码头8座，配有3台200吨门式起重机，1台400吨门式起重机等各类配套吊运设施。公司于2007年进军船舶制造领域，目前拥有钢加工、分段装焊、管子加工、涂装等厂房共计12万平方米，5000吨、10000吨级船台各1座，以及年处理能力达20万吨的钢材预处理流水线等多个重要生产设施。近年来，大连中远船务顺应形势发展，坚持改革创新，市场地位和品牌价值不断提升，综合实力和业务范围不断扩大，实现了从单一修船到修船、造船、海工三业并举的产品转型。公司拥有OBO、PCTC、VLCC、VLOC、FPSO等多种特殊船型的修理和改装实力，先后成功改装完成了“海洋骄傲”、“太阳神松寿”、“卡普”、“柏松”、“旭日东升”等多个FPSO，被业界誉为“中国第一FPSO改装工厂”。公司还承接了世界最大深水钻井船、系列JACK-UP自升式钻井平台、小型LNG运输船、3万吨教学实习船、PSV、DSV、12000吨抬浮力打捞工程船、模块运输船、22000吨成品油轮以及系列30000吨重吊船、57000吨散货船、80000吨散货船、82000吨散货船、92500吨散货船等海工和船舶建造项目，并为韩国三星自主设计建造了世界最大的50万吨级浮船坞。公司于2011年被评定为“国家高新技术企业”。','4771fdc4-7c5f-4be5-963c-643c89a26a48','2017-12-05 00:10:18.0652848',NULL,NULL,NULL,NULL,'2017-12-05 00:11:10.3107254','4771fdc4-7c5f-4be5-963c-643c89a26a48','大连中远船务工程有限公司','',NULL,NULL,NULL,'','',NULL,NULL,NULL,NULL,200,12,'企业',0),
 (11,NULL,NULL,NULL,NULL,NULL,NULL,'甘-10-2','中国第一重型机械集团大连加氢反应器制造有限公司（以下简称“大连加氢公司”）是中国第一重型机械股份公司的全资子公司，位于大连市甘井子区大连湾镇棉花岛，注册资金204,868万元，厂区三面临海，交通便利。中国一重集团一直以建设成为具有国际竞争力的大型企业集团为目标，不断开拓进取。为走向世界、做大做强积极调整发展战略。一重的主要产品是关系到国民经济的重要产品属于大型、超大型设备，加氢反应器单台最重可达2000吨，大型成套轧制设备的单个机架重量可达300吨左右，陆路根本无法运出，必须有临港码头，公司总部正是受到大型产品运输的限制，为了容器产品可直接出口以及更长远的发展，选择了在大连注册子公司，自行建造3000T级码头，主要用于大型、超大型设备的运输，为企业在国际市场上具有一定的竞争优势创造更好的条件。在秦山核电公司60万千瓦级核反应堆压力容器、稳压器制造成功的基础上，由我公司承制的我国首台完全自主化红沿河核电站1#机组百万千瓦级核反应堆压力容器发往红沿河，此举标志着我国百万千瓦级核岛主设备已完全实现国产化，达到了国际先进水平，标志着我公司核电主设备方面又取得了重大、阶段性的突破，为后续产品制造积累了宝贵的经验。几年的发展过程中荣获过很多的奖项。','4771fdc4-7c5f-4be5-963c-643c89a26a48','2017-12-05 00:10:59.5463478',NULL,NULL,NULL,NULL,NULL,NULL,'一重加氢公司','',NULL,NULL,NULL,'','',NULL,NULL,NULL,NULL,200,12,'企业',0),
 (12,NULL,NULL,NULL,NULL,NULL,NULL,'甘-10-3',NULL,'4771fdc4-7c5f-4be5-963c-643c89a26a48','2017-12-05 00:11:36.2819547',NULL,NULL,NULL,NULL,NULL,NULL,'大连大公路北方有限公司','',NULL,NULL,NULL,'','',NULL,NULL,NULL,NULL,200,12,NULL,0),
 (13,NULL,NULL,NULL,'陈继状','87125687','法人','甘-10-4','辽宁省大连海洋渔业集团公司（简称辽渔集团） 坐落于辽东半岛大连湾畔，始建于1945年，是省属国有独资的综合性大型渔业联合企业。企业资产总值达94亿元，员工6000余人，海陆域总面积近300万平方米，目前已形成集海洋捕捞、港口航运、水产品交易、水产品加工、冷藏、国内外营销、船舶修造、地产开发、物资供应等多产业多元化的经营格局，成为国内同行业最具综合规模优势、产业链条最为完整的现代化渔业基地。“十三五”期间，辽渔集团将致力建设成为以海洋为依托，以海洋食品为龙头，以捕捞、冷藏、渔港、客滚、修造船、水产品贸易、食品加工、冷链物流为支撑的全产业链的现代服务型企业集团。','4771fdc4-7c5f-4be5-963c-643c89a26a48','2017-12-05 00:12:05.8478873',NULL,NULL,NULL,NULL,NULL,NULL,'辽宁省大连海洋渔业集团','',NULL,NULL,NULL,'','',NULL,NULL,NULL,NULL,200,12,NULL,0),
 (14,NULL,NULL,NULL,'杨树华','13842619009','法人','甘-10-5','大连远辰客运有限公司是原辽宁省大连海洋渔业集团下属公司，为落实国家大型国有企业主辅分离政策，2003年9月从辽宁省大连海洋渔业集团公司分离出来，经辽宁省国资委和大连市体改委批准改制，由大连市工商局批准注册成立大连市远辰运输有限公司，2006年更名为大连远辰客运有限公司。公司占地20000平方米，建筑面积4000平方米。公司下属公交客运分公司、环路客运分公司、旅游通勤分公司、汽车出租分公司、货运分公司、大连湾维修厂、金南路修配厂、加油站（正在动迁中）、三元水产冷库九个经营实体。现有职工287人，营运车辆160辆，固定资产4068万元。公司是从1992年开始从事道路客运，2005年开始将近郊长途客运实行公交化管理，特别是公司所在地变成城市街道后，加快了公交化进程，公司现有客运线路青泥洼桥至大连湾、解放路至大连湾、解放路至大连湾快速班线，青泥洼桥至前关、苏家工业区至姚家、湾环1、2、3、4路、大连湾至拉树房、大连湾至北乐、甘井子至棋盘十一条线路。','4771fdc4-7c5f-4be5-963c-643c89a26a48','2017-12-05 00:12:33.6037608',NULL,NULL,NULL,NULL,NULL,NULL,'大连远辰客运有限公司','',NULL,NULL,NULL,'','',NULL,NULL,NULL,NULL,200,12,NULL,0),
 (15,NULL,NULL,NULL,NULL,NULL,NULL,'甘-10-6','华能大连电厂坐落在大连湾海边，靠近大连经济技术开发区，距市中心约30公里。该厂以合资方式始建于1986年，主要利用外资成套引进了80年代具有国际先进水平的现代化设备，1988年建成投产。一期工程投用的两套火力发电机组，具有70万千瓦的发电能力。几年来，该厂年发电量都在38亿度以上，工厂生产的全过程基本实现了自动化控制。
